import { Navbar } from "react-bootstrap";

const NavbarComp = () => (
  <>
    <Navbar bg="dark">
      <Navbar.Brand href="#home">
        <HomeIcon
          color="secondary"
          className="d-inline-block align-top"
          width="30"
          height="30"
        />
      </Navbar.Brand>
    </Navbar>
  </>
);

export default NavbarComp;
